        "noTimeScale": false,
        "valuesTracking": "1",
        "chartType": "line",
        "fontColor": "#787b86",
        "gridLineColor": "rgba(240, 243, 250, 0.06)",
        "container_id": "tradingview_38e0f"
      }
    )
  })
  return (
    <div className="App">
      <p>askdlj</p>
      <Trading></Trading>
    </div>
  );
}

export default App;
